INSERT INTO TB_CLASSIFICACAO (CO_SERVICO,CO_CLASSIFICACAO,NO_CLASSIFICACAO,DT_COMPETENCIA,CO_VERSAO, ST_ACAO) VALUES ("159", "002", "Atenção Básica com Saúde Bucal", "202308", "08/2020A", "7");
INSERT INTO TB_CLASSIFICACAO (CO_SERVICO,CO_CLASSIFICACAO,NO_CLASSIFICACAO,DT_COMPETENCIA,CO_VERSAO, ST_ACAO) VALUES ("159", "003", "Academia da Saúde", "202308", "01/2017A", "2");
INSERT INTO TB_CLASSIFICACAO (CO_SERVICO,CO_CLASSIFICACAO,NO_CLASSIFICACAO,DT_COMPETENCIA,CO_VERSAO, ST_ACAO) VALUES ("159", "004", "Estratégia de Saúde da Família", "Composta por equipe multiprofissional que possui, no mínimo, médico generalista ou especialista em saúde da família ou médico de família e comunidade, enfermeiro generalista ou especialista em saúde da família, auxiliar ou técnico de enfermagem e agentes comunitários de saúde (ACS).", "202308", "06/2020C", "2");
INSERT INTO TB_CLASSIFICACAO (CO_SERVICO,CO_CLASSIFICACAO,NO_CLASSIFICACAO,DT_COMPETENCIA,CO_VERSAO, ST_ACAO) VALUES ("159", "005", "Saúde Bucal", "Realiza cuidado em saúde bucal com uma equipe de trabalho que se relacione com usuários e que participe da gestão dos serviços para dar resposta às demandas da população e ampliar o acesso às ações e serviços de promoção, prevenção e recuperação da saúde bucal, por meio de medidas de caráter coletivo e mediante o estabelecimento de vínculo territorial.", "202308", "06/2020C", "2");
INSERT INTO TB_CLASSIFICACAO (CO_SERVICO,CO_CLASSIFICACAO,NO_CLASSIFICACAO,DT_COMPETENCIA,CO_VERSAO, ST_ACAO) VALUES ("159", "006", "Núcleo Ampliado de Saúde da Família e Atenção Primária", "Equipes multiprofissionais que atuam de forma integrada com as equipes de Saúde da Família (eSF), as equipes de Atenção Básica para populações específicas (consultórios na rua, equipes ribeirinhas e fluviais) e com o Programa Academia da Saúde, realizando discussões de casos clínicos, o atendimento compartilhado entre profissionais, tanto na Unidade de Saúde como nas visitas domiciliares e possibilita a construção conjunta de projetos terapêuticos de forma a ampliar e qualificar as intervenções no território e na saúde de grupos populacionais. Essas ações de saúde também podem ser intersetoriais, com foco prioritário nas ações de prevenção e promoção da saúde.", "202308", "06/2020C", "2");
INSERT INTO TB_CLASSIFICACAO (CO_SERVICO,CO_CLASSIFICACAO,NO_CLASSIFICACAO,DT_COMPETENCIA,CO_VERSAO, ST_ACAO) VALUES ("159", "007", "Atenção Primária para População Ribeirinha", "Equipes que desempenham a maior parte de suas funções em Unidades Básicas de Saúde (UBS) construídas/localizadas nas comunidades pertencentes a regiões à beira de rios e lagos cujo acesso se dá por meio fluvial", "202308", "06/2020C", "2");
INSERT INTO TB_CLASSIFICACAO (CO_SERVICO,CO_CLASSIFICACAO,NO_CLASSIFICACAO,DT_COMPETENCIA,CO_VERSAO, ST_ACAO) VALUES ("159", "008", "Consultório na Rua", "Equipes multiprofissionais que desenvolvem ações integrais de saúde frente às necessidades da população em situação de rua Elas devem realizar suas atividades de forma itinerante e, quando necessário, desenvolver ações em parceria com as equipes das Unidades Básicas de Saúde do território.", "202308", "06/2020C", "2");
INSERT INTO TB_CLASSIFICACAO (CO_SERVICO,CO_CLASSIFICACAO,NO_CLASSIFICACAO,DT_COMPETENCIA,CO_VERSAO, ST_ACAO) VALUES ("159", "009", "Atenção Primária para População Prisional", "Equipe que desenvolve ações de saúde do Sistema Único de Saúde (SUS) para a população privada de liberdade, fazendo com que cada unidade básica de saúde prisional passasse a ser visualizada como ponto de atenção da Rede de Atenção à Saúde.", "202308", "06/2020C", "2");
INSERT INTO TB_CLASSIFICACAO (CO_SERVICO,CO_CLASSIFICACAO,NO_CLASSIFICACAO,DT_COMPETENCIA,CO_VERSAO, ST_ACAO) VALUES ("159", "010", "Atenção Primária para Adolescentes em Unidade Socioeducativa", "Equipe que desenvolve ações de atenção integral à saúde de adolescentes em situação de privação de liberdade, em unidades de internação, de internação provisória e de semiliberdade.", "202308", "06/2020C", "2");
